import React from 'react';
import CartItem from './CartItem';

const Cart=(props)=> {
    
    const { products } = props.state;
    return (
      <div className="cart">
        {products.map((product) => {
          return (
            <CartItem
              product={product}
              key={product.id} 
              onIncreaseQuantity={props.handleIncreaseQuantity}
              onDecreaseQuantity={props.handleDecreaseQuantity}
              onDeleteQuantity={props.handleDeleteQuantity}
            />
          )
        })}
      </div>
    );
  }


export default Cart;
